window.bookSummaryJSON = "<p><b>Raven Black returns in another heart-pounding installment of the</b><b><i> USA Today</i></b><b> best-selling Crossbreed series.</b></p> <p>Vampire trafficking is a sinister business, and nobody knows that better than Keystone. After Raven discovers hidden clues in a cold case, the group sets a trap in hopes of catching an elusive criminal. But when the plan backfires, Raven's world is thrown into chaos, and Christian's loyalty is put to the ultimate test.</p> <p>Buried secrets come to light, and the only thing keeping Raven grounded is her insatiable thirst for vengeance. The stakes are high as they travel to a place where the landscapes are as treacherous as the immortals who live there. This time, there's no room for mistakes.</p> <p>Will Raven have the courage to tame the violence in her heart before it swallows her whole?</p>"; 
